import React, { useState } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

// Styled Components
const PageContainer = styled.div`
  padding: 120px 5% 80px;
  min-height: 100vh;
`;

const PageTitle = styled.h1`
  font-size: 3.5rem;
  font-weight: 300;
  margin-bottom: 40px;
  color: ${props => props.theme.colors.secondary};
  position: relative;
  letter-spacing: -1px;
  
  &:after {
    content: '';
    position: absolute;
    bottom: -20px;
    left: 0;
    width: 60px;
    height: 1px;
    background-color: ${props => props.theme.colors.highlight};
  }
`;

const IntroText = styled.p`
  font-size: 1.3rem;
  line-height: 1.8;
  color: ${props => props.theme.colors.textSecondary};
  margin-bottom: 60px;
  max-width: 900px;
`;

const ModelsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 30px;
  margin-bottom: 60px;
  
  @media (max-width: ${props => props.theme.breakpoints.tablet}) {
    grid-template-columns: repeat(2, 1fr);
  }
  
  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const ModelCard = styled.div<{ selected: boolean }>`
  position: relative;
  transition: all 0.3s ease;
  padding: 25px;
  background: linear-gradient(145deg, rgba(20, 20, 20, 0.7), rgba(10, 10, 10, 0.9));
  border: ${props => props.selected ? `2px solid ${props.theme.colors.highlight}` : '1px solid rgba(255, 255, 255, 0.1)'};
  box-shadow: ${props => props.selected ? '0 10px 25px rgba(0, 0, 0, 0.3)' : '0 5px 15px rgba(0, 0, 0, 0.2)'};
  cursor: pointer;
`;

const ModelImage = styled.div`
  height: 240px;
  margin-bottom: 30px;
  overflow: hidden;
  display: flex;
  justify-content: center;
  width: 100%;
  
  img {
    height: 100%;
    width: 100%;
    object-fit: contain;
    transition: transform 0.6s ease;
  }
  
  ${ModelCard}:hover img {
    transform: scale(1.03);
  }
`;

const ModelName = styled.h3`
  font-size: 1.4rem;
  font-weight: 300;
  margin-bottom: 10px;
  color: ${props => props.theme.colors.secondary};
  letter-spacing: 0.5px;
`;

const ModelCategory = styled.span`
  display: inline-block;
  font-size: 0.8rem;
  font-weight: 500;
  color: ${props => props.theme.colors.primary};
  background-color: ${props => props.theme.colors.highlight};
  padding: 4px 12px;
  margin-bottom: 15px;
  text-transform: uppercase;
  letter-spacing: 1px;
`;

const ButtonContainer = styled.div`
  display: flex;
  justify-content: flex-end;
  margin-top: 20px;
`;

const SelectButton = styled.button`
  background-color: ${props => props.theme.colors.highlight};
  color: ${props => props.theme.colors.primary};
  font-size: 0.9rem;
  font-weight: 500;
  padding: 10px 25px;
  border: none;
  text-transform: uppercase;
  letter-spacing: 1px;
  transition: all 0.3s ease;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  cursor: pointer;
  
  &:hover {
    background-color: ${props => props.theme.colors.secondary};
  }
  
  &:after {
    content: '→';
    font-size: 1.2rem;
    margin-left: 10px;
  }
`;

interface ModelType {
  id: string;
  name: string;
  category: string;
  image: string;
}

const TestDrivePage: React.FC = () => {
  const [selectedModel, setSelectedModel] = useState<string | null>(null);
  const navigate = useNavigate();
  
  const models: ModelType[] = [
    { id: 'lbx', name: 'Lexus LBX', category: 'Compact', image: '/images/lex_lbx_side_2.png' },
    { id: 'ux', name: 'Lexus UX', category: 'Compact SUV', image: '/images/lex_ux_side.png' },
    { id: 'rz', name: 'Lexus RZ', category: 'Electric', image: '/images/lexus_rz.png' },
    { id: 'nx', name: 'Lexus NX', category: 'SUV', image: '/images/lexus_nx.png' },
    { id: 'rx', name: 'Lexus RX', category: 'Premium SUV', image: '/images/lexus_rx.png' },
    { id: 'es', name: 'Lexus ES', category: 'Sedan', image: '/images/lexus_es.png' },
    { id: 'ls', name: 'Lexus LS', category: 'Luxury Sedan', image: '/images/lexus_ls.png' },
  ];
  
  const handleSelectCar = (modelId: string) => {
    alert(`Bedankt voor het kiezen van de ${models.find(m => m.id === modelId)?.name}. Een Lexus-vertegenwoordiger zal binnenkort contact met u opnemen om uw proefrit te plannen.`);
    navigate('/experience');
  };
  
  return (
    <PageContainer>
      <PageTitle>In welk model wilt u proefrijden?</PageTitle>
      
      <IntroText>
        Ervaar de uitzonderlijke prestaties, vakmanschap en innovatie van Lexus uit eerste hand. Selecteer hieronder een model om uw persoonlijke proefrit te plannen.
      </IntroText>
      
      <ModelsGrid>
        {models.map(model => (
          <ModelCard 
            key={model.id} 
            selected={selectedModel === model.id}
            onClick={() => setSelectedModel(model.id)}
          >
            <ModelImage>
              <img src={model.image} alt={model.name} />
            </ModelImage>
            <ModelCategory>{model.category}</ModelCategory>
            <ModelName>{model.name}</ModelName>
            
            {selectedModel === model.id && (
              <ButtonContainer>
                <SelectButton onClick={() => handleSelectCar(model.id)}>
                  KIES DEZE AUTO
                </SelectButton>
              </ButtonContainer>
            )}
          </ModelCard>
        ))}
      </ModelsGrid>
    </PageContainer>
  );
};

export default TestDrivePage;
